import { Link } from "react-router-dom"

const list = [
  { path: 'kijowska', title: 'Kijowska' },
  { path: 'sofijska', title: 'Sofijska' },
  { path: 'archangielski', title: 'Archangielski' },
]

export const Ectenias = () => {
  return (
    <>
      <ul className="library">
        <li className="library__element">
          <Link to={list[0].path} className="itemLink">
            {list[0].title}
          </Link>
          <Link to={list[1].path} className="itemLink">
            {list[1].path}
          </Link>
          <Link to={list[0].path} className="itemLink">
            {list[2].path}
          </Link>
        </li>
      </ul>
    </>
  )
}
